import styled from 'styled-components';

const Styles = styled.div`

`;

const SizeRange = ({ state, resetArray }) => {
  console.log(state.size);
  return(
    <Styles>
      <input 
        type="range" 
        min={5} 
        max={500} 
        value={state.size} 
        className="slider" 
        onChange={(event) => console.log(event.target.value)} />
    </Styles>
    )
}

export default SizeRange
